import React from "react";

const Sresult = (props) =>{
    const imgsrc =`https://source.unsplash.com/500x400/?${props.text}`;
    return (
        <>
            <div className="resultImg">
                {props.text !=="" ? <img src={imgsrc} alt="search"/> :null}
            </div>
        </>
    );
}
export default Sresult;
